import CategoryNewsItem from '../item/CategoryNewsItem'

const CategoryNews = () => {
  var list = []
  for (var i = 0; i < 6; i++) {
    list.push(
      <div className="column">
        <CategoryNewsItem />
      </div>
    )
  }
  return (
    <section className="category-news columns w-100 m-v-10" style={{ display: 'grid', 'grid-template-columns': '50% 50%', 'grid-auto-flow': 'dense' }}>
      {list}
    </section>
  )
}

export default CategoryNews
